import React from 'react'
import './style.css'
const test = ()=>{
    const { text } = this.state;
    const isEnabled = text.length > 0;


   return (
    <div>
        <h1>This is valid Input</h1>
        <input type="text" className="formControl" placeholder="Enter Your Name Here!" />
        <h1>This is Disabled Input</h1>
        <input type="text" className="formControl" placeholder="" disabled="disabled" />
        <h1>Input Box with errors</h1>
        <input type="text" className="formControlIsInvalid formControl" placeholder="" />
        <input disabled={!isEnabled} />
    </div>

   )
}
export default test;
